import Container from "../../design_system/Atoms/Container/container.view";
import Input from "../../design_system/Atoms/Input/input.view";

export default function Home() {
  return (
    <>
      <Container>
        <div>     
          <Label></Label>   
          <Input
            type={""}
            placeholder={"Insira sua User-Key aqui..."}
            id={"userkey"}
          />
        </div>
      </Container>
    </>
  )
}
